import React, { Component } from 'react';
import LogEntry from './LogEntry'

class InsulinLog extends Component{


  generateLogEntries=(entries)=>{

    return entries.map(entryObj=><LogEntry entryObj={entryObj} key={entryObj.id}/>)
  }




  render(){
    console.log(this.props)
    return(
      <div className="ui bottom attached active tab segment">

      <table className="ui celled table">

      <thead>
          <tr>
          <th>Date</th>
          <th>Start Time</th>
          <th>End Time</th>
          <th>Insulin Name</th>
          <th>Insulin Duration</th>
          <th>Time Left</th>
          <th>Status</th>
          </tr>
        </thead>

      <tbody>
      {this.generateLogEntries(this.props)}
      </tbody>

      </table>
    </div>

    )
  }
}

export default InsulinLog
